            `,-1),tK=s(),eK=i("div",{class:"callout-list link-large"},[i("p",null,"The AHRC\u2019s Guideline on the application of the Premises Standards is the guidance used most by the building profession and people living with disability."),s(),i("p",null,"The opportunity exists for the AHRC, in conjunction with the Australian Government, to review and update the guideline to ensure it is:"),s(),i("ul",null,[i("li",{class:"link-large"},"up to date"),s(),i("li",{class:"link-large"},"relevant to stakeholders who want to understand their rights and responsibilities.")]),s(),i("p",null,"This will lead to improved access to premises.")],-1),oK=s(),nK=i("div",{class:"heading-extra-small-caps text-primary mb-4"},`
